import React from "react"

class Izvestaji extends React.Component{
    constructor(){
        super()
        this.state = {
            izvestaji:[],
            pocetak:"",
            kraj:""
        }
        this.handleChange=this.handleChange.bind(this)
        this.handleClick=this.handleClick.bind(this)
    }

    handleClick(){
        console.log(this.state)
    }

    handleChange(event){
        const {name,value} = event.target
        this.setState({
            [name]:value
        })
    }

    render(){
        return(
            <div id="izvestaji">
                <input type="datatime-local" name="pocetak" placeholder="Pocetak izvestaja..."/>
                <input type="datatime-local" name="kraj" placeholder="Kraj izvestaja..."/>
                <button onClick={this.handleClick}>Kreiraj izvestaj</button>
            </div>
        )
    }
}

export default Izvestaji
